var canvas=document.getElementById("renderCanvas");var engine=new BABYLON.Engine(canvas,true);var createScene=function(){var e=new BABYLON.Scene(engine);var n=new BABYLON.ArcRotateCamera("Camera",Math.PI/2,Math.PI/2,22,BABYLON.Vector3.Zero(),e);n.attachControl(canvas,true);var r=new BABYLON.HemisphericLight("light1",new BABYLON.Vector3(1,1,0),e);var a=new BABYLON.PointLight("light2",new BABYLON.Vector3(0,1,-1),e);var t=BABYLON.MeshBuilder.CreateSphere("sphere",{diameter:2},e);return e};var scene=createScene();engine.runRenderLoop(function(){scene.render()});window.addEventListener("resize",function(){engine.resize()});